import React from "react";
import BlocksRow from "./BlocksRow";

function Board () {
    const board = []
    for (let index = 0; index < 8; index++) {
        id = index % 2
        board.push(<BlocksRow id/>)        
    }
    return (
        <div>
            <table>
                {board}
            </table>
        </div>
    )
    
}

export default Board
